	void setInputValue(double signalIn) {
		Vin->Vs = -params[0].value * signalIn;
	}

	double getOutputValue() {
		return (RK3->upPort->getPortVoltage() - 180.0) / 200.0;
	}

	const char* getTreeIdentifier() {
		return treeName.c_str();
	}

	void setParam(size_t paramID, double paramValue) {
		if (paramID == 0) {         //Volume
            params[0].value = paramValue;
        } else if (paramID == 1) {  // Gain
        	params[1].value = paramValue;
        	RVBP->R = RVol * (1 - params[1].value);
        	RVBN->R = RVol * params[1].value;
        	RVNN->R = RVol * params[1].value;
        	RVNP->R = RVol * (1 - params[1].value);
            adaptTree();
        }
	}
